import logo from "./logo.svg";
import "./App.css";
import axios from "axios";

function App() {
  let componentDidMount = () => {
    // Simple POST request with a JSON body using axios
    const movies = { title: "React POST Request Example" };
    axios
      .post("https://movie-task.vercel.app/api/popular?page=1", movies)
      .then((response) => console.log({ movieid: response.results.id }));
  };

  return (
    <div className="App">
      <header onClick={componentDidMount} className="App-header">
        Learn React
      </header>
    </div>
  );
}

export default App;
